//componenets
import Logo from "../components/Logo";

const LoginSign = () => {
  return (
    <div id="loginSign">
      <Logo size="40px" />
      <br />
      <h1>Log In</h1>
      <br />
      <div id="loginContainer">
        <input type="text" placeholder="Username" />
        <input type="password" placeholder="Password" />
        <button>Log In</button>
      </div>
    </div>
  );
};

export default LoginSign;
